import React from 'react';
import FacebookIcon from '@material-ui/icons/Facebook';
import WhatsAppIcon from '@material-ui/icons/WhatsApp';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import GitHubIcon from '@material-ui/icons/GitHub';



function Card() {
    return (
        <>
            <div className="card">
                <div className="heading">
                </div>
                <img className="profile" src="./Image/Sank.jpg" alt="" />
                <h1 class="name">   SHASHANK TIWARI</h1>
                <h2 className="Pro">I m a Web developer</h2>
                <div class="icon">
                    <ul>
                        <a href=" "> <li className="fb"><FacebookIcon /></li></a>
                        <a href=" "> <li className="whats"><WhatsAppIcon /></li></a>
                        <a href=" "><li className="linkd"><LinkedInIcon /></li></a>
                        <a href=" "><li className="git"><GitHubIcon /></li></a>
                      </ul>
                      
                </div>
                <a href="#" class="button">Link Button</a>
            </div>




        </>
    );
}
export default Card;
